import React from "react";
import { Link } from "react-router-dom";
import logo from '../assets/logo.png';

const Navbar = () => {
  return (
    <nav className="flex ">
      <div  className="w-full p-[1px] flex justify-between items-center">
      <img src={logo} className="h-[20px]"/>
      <Link to="/"  className="menuItem hover:scale-110 hover:z-50 transition-all duration-300 ease-in-out">Login/signup</Link>
      <Link to="/home" >Home</Link>
      <Link to="/internships" >Internships</Link>
      <Link to="/apply" >Apply</Link>
      <Link to="/profile" >Profile</Link>
      </div>
    </nav>
    
  );
};

export default Navbar;
